        self.ref_y = [self.get_y(t) for t in range(0, int(TRAJECTORY_LENGTH*30))]
        self.ref_z = [self.get_z(t) for t in range(0, int(TRAJECTORY_LENGTH*30))]

        if self.VERBOSE:
            self._draw_trajectory(initial_info)
        

