    def get_x(self, step):
        R = 1
        r = 0.5
        t = step / 30
        u = step / 10
        return np.cos(t) * (R + r*np.cos(u)) - 1.5
    def get_y(self, step):
        R = 1
        r = 0.5
        t = step / 30
        u = step / 10
        return np.sin(t) * (R + r*np.sin(u))
    def get_z(self, step):
        R = 1
        r = 0.5
        t = step / 30
        u = step / 10
        return 1+0.5*r*np.sin(u)

